        mHdltvoutHandle << " , " <<  " \"dmem_i_V_read\" :  \"" << dmem_i_V_read.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dmem_o_V_din\" :  \"" << dmem_o_V_din.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dmem_o_V_full_n\" :  \"" << dmem_o_V_full_n.read() << "\" ";
